Sebastien is a psychological horror story about dark secrets destroying people and their families from the inside out.A NYC family is stuck in the hamster wheel of money and spending and position. When the mom, Cecile, loses a baby, the family decides to simplify their lives and move to the country. The house they choose slowly lets it be known that it has chosen them as well and the mystery and connection unfolds in a terrifying and tragic reveal. 

Directors: Zach Miller, Deborah Twiss
Writer: Deborah Twiss
Stars: Eric Roberts, Cathy Moriarty, Deborah Twiss
Genres: Horror | Mystery | Thriller
Country: USA
Language: English

